import React from "react";

const index = () => {
  return (
    <div className="container-fluid">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <h3>Manager Users</h3>
            <table className="table"></table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default index;
